      program_id: nrx.id,
      description: "Your result for this test is in the CLINICAL LOW range. Non-high-density lipoprotein cholesterol (non-HDL-C) is the total amount of cholesterol contained in lipoproteins other than high-density lipoprotein (HDL). HDL is a particle that contains cholesterol, which is called HDL cholesterol or HDL-C. Non-HDL-C is calculated from the results of a lipid profile by subtracting the HDL-C result from the total cholesterol. Lipoproteins are responsible for the transport and metabolism of cholesterol. Low-density lipoproteins (LDL) transport cholesterol from the liver to other tissues, including blood vessel walls. Therefore, high LDL cholesterol (LDL-C) is considered to be associated with the development of hardening of the arteries (atherosclerosis) and cardiovascular disease (CVD). High density lipoproteins (HDL) have an inverse function - they transport cholesterol from the blood vessels to the liver, thus providing protection against CVD. Monitoring and maintaining healthy levels of lipids is important for staying healthy. Eating too much of foods that are high in saturated fats and trans unsaturated fats (trans fats) or having an inherited predisposition can result in a high level of cholesterol in the blood. The extra cholesterol may be deposited in plaques on the walls of blood vessels. Plaques can narrow or eventually block the opening of blood vessels, leading to atherosclerosis and increased risk of numerous health problems, including heart disease and stroke. Additionally, rupture of plaque can cause a heart attack. In the standard lipid profile, the level of total cholesterol and HDL-C are measured. LDL-C is usually not measured directly but is calculated from the results of the other components of the lipid profile, including total cholesterol, HDL cholesterol (HDL-C), and triglycerides. Non-HDL-C may be reported as part of the lipid profile. It reflects the amount of cholesterol in all fractions of lipoproteins that may contribute to your risk of heart disease (atherogenic): LDL, intermediate and very low density lipoproteins (IDL, VLDL) and lipoprotein a (Lp (a))."
