      description:  "Your result for this lab test is in the FUNCTIONAL LOW range. Serum Glucose is a measurement to see how well your body is controlling your blood sugar levels over a shorter period of time - about the past 12 - 24 hours. Glucose is the preferred source of fuel for all the cells in your body. It is also the most important source of fuel for your brain and nervous system which has the greatest need for healthy Glucose levels because it alone consumes about 50% of the glucose in your body. Your Glucose can vary quite a bit even within the same day based on what you are eating and drinking. The most reliable method for testing Serum Glucose is after doing a 12 hour fasting meaning there is no eating or drinking (except water) for 12 hours prior to your blood draw.
     When Glucose is in the Functional Low range it means your blood sugars are falling too low at times for the best function of your body. This is sometimes referred to as “Hypoglycemia” . . . which means low blood sugar. Glucose levels measuring in the 70’s and upper 60’s with lab testing can correlate with a condition called Functional Hypoglycemia or Reactive Hypoglycemia. People with this type of Hypoglycemia usually don’t feel good if they go too long between meals, and can experience symptoms of fatigue, weakness, headaches and even shakiness until they eat food to feel better again. Hypoglycemia can also contribute to feelings of anxiety or panic attacks. People with Reactive Hypoglycemia often have “insulin resistance” . . . meaning the cells in your body have become resistant to the effect of insulin. Insulin is a hormone produced by your pancreas which helps to transport sugar from the blood and bring it into your cells to be used as energy. If your cells become resistant to the effect of insulin, then blood sugar levels will usually go much higher before the body will correct this and bring these glucose levels back down. This can often result in your blood sugar levels dropping down too fast causing low blood sugar or hypoglycemia. These ups and downs of blood sugar, and the tendency for insulin resistance and hypoglycemia, can be the beginning of what turns into diabetes later in life."
